import React, { useEffect } from 'react';
import "./Booking.css";

function Booking() {
  useEffect(() => {
    const calendar = document.getElementsByClassName('Calendar')[0];
    const currentDate = new Date();
    const currentDay = currentDate.getDay();
    const currentMonth = currentDate.getMonth();
    const currentYear = currentDate.getFullYear();
    const dateRow = document.createElement('tr');
    const dayRow = document.createElement('tr');

    for (let i = 0; i < 7; i++) {
      const dateCell = document.createElement('td');
      const dayCell = document.createElement('th');
      const date = currentDate.getDate() + i;
      const dayIndex = (i + currentDay) % 7;
      const dayName = getDayName(dayIndex);

      if (date <= daysInMonth(currentMonth, currentYear)) {
        dayCell.textContent = dayName;
        dateCell.textContent = date;
        dateCell.innerHTML = '<button id=' + i + ' onclick="changeColor(this)">' + date + '</button>';
      }
      dayRow.appendChild(dayCell);
      dateRow.appendChild(dateCell);
    }

    calendar.appendChild(dayRow);
    calendar.appendChild(dateRow);
  }, []);

  const getDayName = (dayIndex) => {
    const days = ['Sunday', 'Monday', 'Tuesday', 'Wednesday', 'Thursday', 'Friday', 'Saturday'];
    return days[dayIndex];
  };

  const daysInMonth = (month, year) => {
    return new Date(year, month + 1, 0).getDate();
  };

  const changeColor = (button) => {
    const currentButtonId = button.id;
    const previousButtonId = button.previousButtonId;

    if (previousButtonId) {
      const previousButton = document.getElementById(previousButtonId);
      previousButton.style.backgroundColor = ""; // Set to default color
      previousButton.style.color = ""; // Set to default color
    }

    const currentButton = document.getElementById(currentButtonId);
    currentButton.style.backgroundColor = "#30D5C8";
    currentButton.style.color = "black";
    currentButton.style.textShadow = "1px 1px 2px black";

    button.previousButtonId = currentButtonId;
  };

  return (
    <>
      <table className="Calendar"></table>
      <table className="Tables">
        <tr>
          <td><input type='button' onClick={changeColor} id="1T" value='Table 1' /></td>
          <td><input type='button' onClick={changeColor} id="2T" value='Table 2' /></td>
          <td><input type='button' onClick={changeColor} id="3T" value='Table 3' /></td>
          <td><input type='button' onClick={changeColor} id="4T" value='Table 4' /></td>
        </tr>
      </table>
      <table className="TimeSlot">
        <tr>
          <td><input type='button' onClick={changeColor} id="4B" value='16:00' /></td>
          <td><input id="8B" onClick={changeColor} type='button' value='20:00' /></td>
        </tr>
        <tr>
          <td><input type='button' onClick={changeColor} id="5B" value='17:00' /></td>
          <td><input id="9B" onClick={changeColor} type='button' value='21:00' /></td>
        </tr>
        <tr>
          <td><input type='button' onClick={changeColor} id="6B" value='18:00' /></td>
          <td><input id="10B" onClick={changeColor} type='button' value='22:00' /></td>
        </tr>
        <tr>
          <td><input type='button' onClick={changeColor} id="7B" value='19:00' /></td>
          <td><input id="11B" onClick={changeColor} type='button' value='23:00' /></td>
        </tr>
      </table>
      <button className="ConfirmBook">Book!</button>
    </>
  );
}

export default Booking;
